function validation() {
    $('#placeOrderBtn').prop('disabled', true);
    var count = 0;
    if ($("#city").val() !== '') {
        if ($("#country").val() == 'LB') {
            var cities = get_lebanese_cities();
            // if (!cities.includes($("#city").val())) {
            //     $('#msg_city').html('You Must Select a City From The Given Options!').css('color', 'red');
            //     count++;
            // } else {
            //     $('#msg_city').html('');
            // }
        } else {
            $('#msg_city').html('');
        }
    }
    else {
        $('#msg_city').html("*" + _lang.Required + "*").css('color', 'red');
        count++;
    }
    if ($("#place").val() !== '') {
        $('#msg_place').html('');
    }
    else {
        $('#msg_place').html("*" + _lang.Required + "*").css('color', 'red');
        count++;
    }
    if ($("#street").val() !== '') {
        $('#msg_street').html('');
    }
    else {
        $('#msg_street').html("*" + _lang.Required + "*").css('color', 'red');
        count++;
    }
    if ($("#building").val() !== '') {
        $('#msg_building').html('');
    }
    else {
        $('#msg_building').html("*" + _lang.Required + "*").css('color', 'red');
        count++;
    }
    // if ($("#floor").val() !== '') {
    //     $('#msg_floor').html('');
    // }
    // else {
    //     $('#msg_floor').html("*"+_lang.Required+"*").css('color', 'red');
    //     count++;
    // }
    if (count !== 0) {
        $('#placeOrderBtn').prop('disabled', false);
        return false;
    } else {
        return true;
    }
}

function get_city_data() {
    if ($('#country').val() == "LB") {
        var cities = get_lebanese_cities();
        var options = '';
        for (var i = 0; i < cities.length; i++) {
            options += '<option value="' + cities[i] + '" />';
        }
        document.getElementById('cities').innerHTML = options;
    } else {
        document.getElementById('cities').innerHTML = '';
    }
}

